def expanded_to_cycles(v, v2, debug=True):
    perm = {}
    for i in range(len(v)):
        perm[i] = v2.index(v[i])

    cycles = []
    pr = perm.copy()
    while pr:
        for c in pr:
            break
        cycle = [c]
        while True:
            c = pr.pop(c)
            cycle.append(c)
            if c == cycle[0]:
                break
        cycle.pop()
        cycles.append(cycle)
        if debug and len(cycle) > 1:
            print("(" + "".join("j_{%d}" % i for i in cycle) + ")", end="")
    if debug:
        print()
    return cycles

def _incl(lst):
    return tuple(a+1 for a in lst)


def _tomat(f):
    a, b = _poly2lin(f.numerator())
    c, d = _poly2lin(f.denominator())
    mat = matrix(a.parent(), 2, 2, [a, b, c, d])
    mat = mat / mat.det().sqrt()
    mat = mat.transpose()
    m1 = mat
    m2 = -mat
    if str(m1) < str(m2):
        return m1
    return m2

def _poly2lin(f):
    try:
        F = f.base_ring()
        t = F(f)
        a, b = F(0), t
        assert f == t
    except TypeError:
        b = f(0)
        a = f(1) - b
        var, = f.parent().gens()
        assert f == var * a + b
    return a, b


def applyN(method, num, value):
    for _ in range(num):
        value = method(value)
    return value
